import React from 'react'

import './IntakeList.css'

import Intake from './Intake'

const IntakeList = props => {

props.editIntake();

    if (props.intakes.lenght === 0) {
        return (
            <div>
                <h2>There should be a list of the programed intakes but it is empty.</h2>
            </div>
        )
    }
    if (!props.program) {
        return (
            <div className="table-responsive">
                <table className="table table-bordered">

                        <thead className="thead-light thead">
                            <tr>
                                <th scope="col" className="noBorderCell">Número de toma</th>
                                <th scope="col" className="noBorderCell">Fecha</th>
                                <th scope="col" className="noBorderCell">Hora</th>
                                <th scope="col" className="noBorderCell">Medicamento</th>
                            </tr>
                            </thead>
                            <tbody>
                            {props.intakes.map(intake => {
                                return <Intake key={intake.id} number={intake.number} date={intake.date} hour={intake.hour} med={intake.med} program={false}></Intake>
                            })}

                    </tbody>
                </table>
            </div>

        )
    }
    if (props.program) {
        return (
            <div className="table-responsive">
                <table className="table table-bordered table-hover">
                        <thead className="thead-light thead">
                            <tr>
                                <th scope="col" className="noBorderCell text-center">Número de toma</th>
                                <th scope="col" className="noBorderCell text-center">Fecha</th>
                                <th scope="col" className="noBorderCell text-center">Hora</th>
                                <th scope="col" className="noBorderCell text-center">Medicamento</th>
                                <th className="text-center tableCorner"></th>
                            </tr>
                            </thead>
                            <tbody>
                            {props.intakes.map(intake => {
                                return <Intake key={intake.id} number={intake.number} date={intake.date} hour={intake.hour} med={intake.med} program={true}></Intake>
                            })}
                    </tbody>
                </table>
                <a id="add_row" className="buttonAddRow btn btn-danger float-right buttonBottom">Cancel</a>
                <a id="add_row" className="buttonAddRow btn btn-success float-right buttonBottom">Save</a>
            </div>

        )
    }
}

export default IntakeList
